    };
    tmnFields.push(item);
    MAP[item.id] = item;
    !$_cache.userIsNormal() && mntIds.push(item.id);
  });
}

function setGpsExts(mntIds, gpsExts) {
  if (!gpsExts || gpsExts.length == 0) return;
  var ext = {
    title: $_L.get('定位扩展'),
    id: 'ext',
    children: []
  };
  gpsExts.forEach(function (w) {
    var id = '_' + w.id;

