    let a01 = { title: $_L.get('侧翻预警'), id: 'a01', field: 'alarmStts', width: 80, align: 'center', labelFunction: Labels.sttsFunction, info: { i: 1, alarm: true, '0': $_L.get('正常'), '1': $_L.get('报警') } };
    let a00 = { title: $_L.get('非法开门报警'), id: 'a00', field: 'alarmStts', width: 80, align: 'center', labelFunction: Labels.sttsFunction, info: { i: 0, alarm: true, '0': $_L.get('正常'), '1': $_L.get('报警') } };

    carFieldsR = [v0, vk, v1, v2, v3, v4, v5, vi, v7, v8, vd, v9, vl, vg, vh, vy, vj, vm];
    carFieldsH = [v0, vk, v1, v2, v3, v7, v8, v9, vl, vf, vm];
    let tmnFields = [t0, t1, t2, t3, t4, t5, t6, t7, t8, t9, ta, tb];
    drvFieldsR = [d0, d1, d2, d3, d4, d5, d6, d7];
    drvFieldsH = [d4, d5, d6, d7];
    let gpsFields = [g1, g2, g3, g4, g5, g6, g7, g8, g9, g10];
    staFieldsR = [y2, y3, y4, y5, y6, y7, y8, y9, y10, y11, y12]; //y1,
    staFieldsH = [y3, y4, y13, y14];
    staFieldsAll = [y2, y3, y4, y5, y6, y7, y8, y9, y10, y11, y12, y13, y14];
    let sttFields = [c31, c30, c29, c28, c27, c26, c22, c21, c20, c19, c18, c17, c16, c15, c14, c13, c12, c11, c10];
    let sgnFields = [s31, s30, s29, s28, s27, s26, s25, s24, s23, s22, s21, s20, s19, s18, s17, s16, s15, s14, s13, s12, s11, s10, s09, s08, s07, s06, s05, s04, s03, s02, s01, s00];
    let alarmFields = [_v0, _v1, _v2, _v3, _v4, _v5, _v6, a31, a30, a29, a28, a27, a26, a25, a24, a23, a22, a21, a20, a19, a18, a17, a16, a15, a14, a13, a12, a11, a10, a09, a08, a07, a06, a05, a04, a03, a02, a01, a00];

    ROOT = [
        { title: $_L.get('车辆信息'), id: 'car', children: carFieldsR },
        { title: $_L.get('终端信息'), id: 'tmn', children: tmnFields },
        { title: $_L.get('驾驶员信息'), id: 'drv', children: drvFieldsR },
        { title: $_L.get('定位信息'), id: 'gps', children: gpsFields },
        { title: $_L.get('运行统计'), id: 'sta', children: staFieldsR },
        { title: $_L.get('基本状态'), id: 'stt', children: sttFields },
        { title: $_L.get('信号线状态'), id: 'sgn', children: sgnFields },
        { title: $_L.get('报警状态'), id: 'alarm', children: alarmFields }
    ];
    MAP = {};
    ROOT.forEach(root => {
        MAP[root.id] = root;
        root.children.forEach(item => {
            item.parent = root;
            item.pid = root.id;
            MAP[item.id] = item;
        });
    });
    staFieldsH.forEach(item => {
        item.parent = MAP.sta;
        item.pid = MAP.sta.id;
        MAP[item.id] = item;
    });
    vf.parent = MAP.car;
    vf.pid = MAP.car.id;
    MAP[vf.id] = vf;

    //同步加载用户权限内的监控字段，车辆基础字段，车辆扩展字段，定位扩展字段
    let mntIds = $_main.http.syncGet('sys/auth?getMntList') || [];
    let carBxts = getCarBxtWidgets().list;
    let carExts = getCarExtWidgets();
    let tmnExts = getTmnExtWidgets();
    let gpsExts = getGpsExtList();
    let cgqExts = $_main.http.syncPost("cmn?getCmnList", { typeId: "BASE_SENSOR" });
    let rtExts = $_main.http.syncPost("cmn?getCmnList", { typeId: "RT_EXT" });

    carBxts && carBxts.length > 0 && setCarBxts(mntIds, carBxts, carFieldsR, carFieldsH); //添加车辆基础字段
