    tmnExts && tmnExts.length > 0 && setTmnExts(mntIds, tmnExts, tmnFields); //添加终端扩展字段
    cgqExts && cgqExts.length > 0 && setCgqExts(mntIds, cgqExts); //添加传感器字段
    gpsExts && gpsExts.length > 0 && setGpsExts(mntIds, gpsExts); //添加定位扩展字段
    rtExts  && rtExts.length > 0  && setRtExts(mntIds, rtExts, carFieldsR); //添加实时扩展字段

    for (let id in MAP) MAP[id].name = MAP[id].title;
    if ($_cache.userIsSys()) return;

    //删除无权限的字段
    arrayRemoveFilter(ROOT, item => mntIds.indexOf(item.id) == -1);
    [carFieldsR, carFieldsH, tmnFields, drvFieldsR, drvFieldsH, gpsFields, staFieldsR, staFieldsH, staFieldsAll, sttFields, sgnFields, alarmFields].forEach(items => arrayRemoveFilter(items, item => mntIds.indexOf(item.id) == -1));
    for (let id in MAP) mntIds.indexOf(id) == -1 && delete MAP[id];
}

function setCarBxts(mntIds, carBxts, carFieldsR, carFieldsH) {
    carBxts.forEach(bxt => {
        if (!columnable(bxt)) return;
        let item = { title: bxt.name, id: bxt.id, pid: 'car', parent: MAP.car, field: bxt.id, width: 80, align: 'center', labelFunction: Labels.carBxtByCarId };
        carFieldsR.push(item);
        carFieldsH.push(item);
        MAP[item.id] = item;
        !$_cache.userIsNormal() && mntIds.push(item.id);
    });
}

function setRtExts(mntIds, rtExts, carFieldsR) {
    rtExts.forEach(w => {
        let id = 'rt_' + w.id;
        if ($_cache.userIsSys()) {
            mntIds.push(id);
        } else if (mntIds.indexOf(id) == -1) {
            return;
        }
        let item = { title: $_L.get(w.name), id: id, pid: 'car', parent: MAP.car, field: w.id, property: w.id, width: 80, align: 'center', info: w.cfg && w.cfg.indexOf("{") == 0 ? JSON.parse(w.cfg) : {}, labelFunction: Labels.rtExtFunction };
        carFieldsR.push(item);
        MAP[item.id] = item;
    });
}

function setCarExts(mntIds, carExts) {
    let cxt = { title: $_L.get('车辆扩展'), id: 'cxt', children: [] };
    carExts.forEach(ext => {
        if (!columnable(ext)) return;
        let item = { title: ext.name, id: ext.id, pid: 'cxt', parent: cxt, field: ext.id, width: 80, align: 'center', labelFunction: Labels.carExtByCarId };
        cxt.children.push(item);
        MAP[item.id] = item;
        !$_cache.userIsNormal() && mntIds.push(item.id);
    });
    if (cxt.children.length) {
        ROOT.splice(1, 0, cxt);
        MAP[cxt.id] = cxt;
        !$_cache.userIsNormal() && mntIds.push(cxt.id);
    }
}

function setTmnExts(mntIds, tmnExts, tmnFields) {
    mntIds.push('tmn');
    tmnExts.forEach(ext => {
        if (!columnable(ext)) return;
        let item = { title: ext.name, id: '_t_' + ext.id, pid: 'tmn', parent: MAP.tmn, field: ext.id, width: 80, align: 'center', labelFunction: Labels.tmnExtByCarId };
        tmnFields.push(item);
        MAP[item.id] = item;
        !$_cache.userIsNormal() && mntIds.push(item.id);
    });
}

function setGpsExts(mntIds, gpsExts) {
    if (!gpsExts || gpsExts.length == 0) return;
    let ext = { title: $_L.get('定位扩展'), id: 'ext', children: [] };
    gpsExts.forEach(w => {
        let id = '_' + w.id;
        if ($_cache.userIsSys()) {
            mntIds.push(id);
        } else if (mntIds.indexOf(id) == -1) {
            return;
        }
        let item = { title: w.name, id: id, pid: 'ext', parent: ext, field: w.id, property: w.id, width: 80, align: 'center', info: w.cfg && w.cfg.indexOf("{") == 0 ? JSON.parse(w.cfg) : {}, labelFunction: Labels.gpsExtFunction };
        ext.children.push(item);
        MAP[item.id] = item;
    });
    if (ext.children.length) {
        ROOT.push(ext);
        MAP[ext.id] = ext;
        mntIds.indexOf(ext.id) == -1 && mntIds.push(ext.id);
    }
}

function setCgqExts(mntIds, cgqExts) {
    let cgq = { title: $_L.get('传感器'), id: 'cgq', children: [] };
    let cfg = $_cache.userCfg.RTL_FAV ? JSON.parse($_cache.userCfg.RTL_FAV) : {}, moniId;
    cgqExts.forEach(f => {
        moniId = '_moni_' + f.id;
        f.id = '_cgq_' + f.id;
        if (!$_cache.userIsNormal()) {
            mntIds.push(f.id);
        } else if (mntIds.indexOf(f.id) == -1) {
            return;
        }
        let item = { title: $_L.get(f.name), id: f.id, pid: 'cgq', parent: cgq, field: f.id, property: f.id, width: 80, align: 'center', params: cfg.moni ? moniId : null, labelFunction: Labels.gpsCgqFunction };
        cgq.children.push(item);
        MAP[item.id] = item;
    });
    if (cgq.children.length) {
        ROOT.push(cgq);
        MAP[cgq.id] = cgq;
        mntIds.indexOf(cgq.id) == -1 && mntIds.push(cgq.id);
    }
}

export function getFieldMap() {
    !MAP && initFields();
    return MAP;
}

export function getFieldRoot(type = null, cxt = true) {
    !MAP && initFields();
    MAP.sta && (MAP.sta.children = (type == 'GPS_TCK_FIELDS'||type == 'GPS_MN'||type == 'GPS_MN0') ? staFieldsH : (type == 'ALL' ? staFieldsAll : staFieldsR));
    MAP.car && (MAP.car.children = (type == 'GPS_TCK_FIELDS'||type == 'GPS_MN'||type == 'GPS_MN0') ? carFieldsH : carFieldsR);
    MAP.drv && (MAP.drv.children = (type == 'GPS_TCK_FIELDS'||type == 'GPS_MN'||type == 'GPS_MN0') ? drvFieldsH : drvFieldsR);

    let index = ROOT.indexOf(MAP.cxt);
    if (!MAP.cxt || (cxt && index != -1)) return ROOT;
    cxt ? ROOT.splice((ROOT.length > 0 && ROOT[0].id == 'car') ? 1 : 0, 0, MAP.cxt) : (index != -1 && ROOT.splice(index, 1));
    return ROOT;
}


