export function getGridModes(type, cfg=null) {
    cfg = cfg || $_cache.userCfg;
    let modes = cfg[type] ? JSON.parse(cfg[type]) : defaultGpsModes[type];
    if (!modes || modes.length == 0) return defaultGpsModes[type];
    return typeof (modes[0]) == 'string' ? [{ name: $_L.get('默认列表'), value: 'default', fixed: 4, fields: modes }] : modes;
}

